/* eslint-disable */
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Headevent from "./components/Headevent";
import Headevent2 from "./components/Headevent2";
import Data from "./components/data";
import { Link, Route, Switch } from 'react-router-dom';

function App() {

  let [글제목, 글제목변경] = useState(['남자 코트 추천', '강남 우동 맛집', '파이썬 독학']); 
  let [따봉, 따봉변경] = useState(0);
  let posts = '강남 고기 맛집';
  let [shoes, shoeState] = useState(Data);

  function 제목바꾸기(){
    var newArray = [...글제목];
    newArray[0] = '여자코트 추천';
    글제목변경( newArray );

    <div className="container">
      <div className="row">
        <Card shoes={shoes}/>
        <Card shoes={shoes}/>
        <Card shoes={shoes}/>
      </div>
    </div>
  }

  return (
    <div className="App">

        <Headevent />
        
        <Headevent2 />
      
      <div className="list">
        <h3> { 글제목[0] } <span onClick={ ()=>{ 따봉변경(따봉 + 1) } }>👍</span> {따봉} </h3>
        <p>2월 19일</p>
        <hr/>
      </div>
      <div className="list">
        <h3> { 글제목[1] } </h3>
        <p>2월 19일</p>
        <hr/>
      </div>
      <div className="list">
        <h3> { 글제목[2] } </h3>
        <p>2월 19일</p>
        <hr/>
      </div>
      <div className="container">
          <div className="row">
            <Card shoes={shoes} />
            <Card shoes={shoes} />
            <Card shoes={shoes} />
          </div>
        </div>
    </div>
  );
}

function Card(){
  return (
    <div className="col-md-4">
      <img src="https://codingapple1.github.io/shop/shoes1.jpg" width="100%" />
      <h3>d</h3>
      <p>{ shoes[0].content } & { shoes[0].price }</p>
    </div>
  )
  }
export default App;
